import Expenses from "./Components/Expenses.js";

function App() {
  const expenses = [
    {
      title: "car",
      amount: 456,
      date: new Date(2021, 3, 18),
    },
    {
      title: "cycle",
      amount: 567,
      date: new Date(2021, 3, 8),
    },
    {
      title: "motercycle",
      amount: 679,
      date: new Date(2021, 3, 28),
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenses title={items.expenses} amount={expenses} date={expenses} />
    </div>
  );
}

export default App;
